IF OBJECT_ID('tempdb.dbo.#JobBidSkeys_for_CWR') IS NOT NULL BEGIN
	DROP TABLE dbo.#JobBidSkeys_for_CWR;
END;
SELECT JobBidSkey
	INTO dbo.#JobBidSkeys_for_CWR
	FROM dmOnDemandReports.Star.factApplication AS fa
	WHERE fa.LoadDate BETWEEN <FROMDATE> AND <TODATE>;

CREATE CLUSTERED INDEX #CIX_JobBidSkeys ON dbo.#JobBidSkeys_for_CWR(JobBidSkey);

INSERT INTO dbo.#JobBidSkeys_for_CWR (JobBidSkey)
SELECT DISTINCT fkr.JobBidSkey
	FROM dmOnDemandReports.Star.factKnockoutReason AS fkr
	LEFT JOIN dbo.#JobBidSkeys_for_CWR AS cwr
		ON fkr.JobBidSkey = cwr.JobBidSkey
	WHERE fkr.LoadDate BETWEEN <FROMDATE> AND <TODATE>
		AND cwr.JobBidSkey IS NULL;

INSERT INTO dbo.#JobBidSkeys_for_CWR (JobBidSkey)
SELECT DISTINCT fas.JobBidSkey
	FROM dwApplicant.dbo.factAssessmentScore AS fas
	INNER JOIN dmOnDemandReports.Star.dimAssessment AS da
		ON fas.AssessmentSkey = da.AssessmentSkey AND fas.ClientSkey = da.ClientSkey
	LEFT JOIN dbo.#JobBidSkeys_for_CWR AS cwr
		ON fas.JobBidSkey = cwr.JobBidSkey
	WHERE fas.LoadDate BETWEEN <FROMDATE> AND <TODATE>
		AND da.AssessmentSource = 'Kronos Assessment'
		AND cwr.JobBidSkey IS NULL;

DECLARE @batchDt datetime = <BATCHDATE>;
DECLARE @src nvarchar(255) = <SOURCE>;
EXEC DataWarehouse.Stage.ETL_LoadInfoTablesForCWR @BatchDate=@batchDt, @Source=@src;
